(8, 9, '1 special', 0, '', 0, 200, 1, '{"count":1,"contents":[{"title":"(aris_特集)ドラゴンクエストX","thumbnail_url":"https://s3-ap-northeast-1.amazonaws.com/pp-contents01/packshot/fffffffb/2427/0/96_c9013733-4135-4b33-9185-a89ac282b65c.jpg","description":"国際的な巨大企業の経営者にして世界有数の頭脳の持ち主である大富豪トニー・スターク。人々の耳目と羨望を集め続けてきた彼のもう一つの顔は、黄金のアベンジャーこと“インビンシブル”アイアンマン。だが、とある先端技術の盗難事件をきっかけに、彼の人生は大きな転換を迎える事となる。そのキーワードは「エクストリミス(死の際にて)」。2005年1月、『ニューアベンジャーズ』シリーズのスタートと共に創刊された『アイアンマン』第4シリーズの冒頭を飾り、世界的な大ヒットを記録した映画シリーズの基礎ともなったアイアンマン史上屈指の名作を映画『アイアンマン3』公開に合わせ邦訳。","fields":[{"group":"3","type":"30","label":"ドラゴンクエストX","value":"http://store.tsutaya.co.jp/item/sell_book/9784591133507.html"},{"group":"3","type":"30","label":"ドラゴンクエストX","value":"http://store.tsutaya.co.jp/item/sell_book/9784591133507.html"},{"group":"3","type":"30","label":"ドラゴンクエストX","value":"http://store.tsutaya.co.jp/item/sell_book/9784591133507.html"},{"group":"3","type":"30","label":"ドラゴンクエストX","value":"http://store.tsutaya.co.jp/item/sell_book/9784591133507.html"}],"score":50.0}]}', 1),
